                "minus": null,
                "text": "Когда товар пришёл к продавцу, мне позвонили, сказали, что могу забрать самовывозом или ждать доставки (заплатила за доставку 1500). Спросила, если заберу сама, мне вернут деньги за доставку? На что ответили, что доставку я оплачивала с другого города до Караганды. Часы должны были доставить 22.12.2020, адрес был указан домашний, я позвонила продавцу, попросив поменять на мой рабочий адрес. Ответили, что мне позвонит предварительно курьер и я ему скажу точный адрес. Курьер предварительно не позвонил, позвонил только когда приехал. Дома никого не оказалось. Попросила подъехать по моему месторасположению, на что курьер ответил: \"нет, я туда не поеду\", причём это было недалеко, 4 остановки от моего дома. Просила курьера привезти до вечера, он отказывался, говорил давайте завтра. В общем, такого я еще никогда не встречала, что сама должна была уговаривать курьера привезти мне доставку до вечера, как-то его ловить (сама уже хотела забрать).  Звонила продавцу, телефон отключён. Нашла их сайт, подняли телефон в другом городе. Сказали звонить на 5555, объясняла ситуацию, что курьер отказывается привезти заказ, девушка просто читала слова как робот: \"с вами курьер свяжется\". Когда я объясняю, что он отказывается привезти. Безвыходность. Никакого разрешения ситуации и поддержки. Заказ в итоге все-таки привёз, после моих звонков и просьб. Выбирала продавца по отзывам, смотрю хорошие, курьеров хвалят. Но видимо мне попался не тот курьер. Очень недовольна и перенервничала с этой доставкой. Заказывать здесь больше не буду."
