            "id": "962c3f03-743a-4d41-b824-e1e14444f4a4",
            "author": "Юрий",
            "date": "11.05.2019",
            "rating": 5.0,
            "comment": {
                "plus": "Товар оправдал все ожидания. Конечно, вначале когда распаковывал коробку с браслетом, было ощущение, что меня надули. Но после дня пользования это чувство ушло полностью. Браслет весьма удобен. Шагометр считает шаги практически точно (проверял), есть небольшая погрешность. Время, звонки, погода, пульс - с этим тоже все хорошо. Заряжается браслет довольно-таки быстро, а заряд держит долго. Также ходил с ним в душ и мочил его. Пока работает.)",
                "minus": "Не хватает того, что нельзя ответить на звонок через браслет, или на СМС. Но это уже кому как.\n",
                "text": "Также не понравился момент с доставкой. Заказывал товар через магазин Xiaomi, а они сотрудничают с курьерской службой Gallop. Так вот, заказал я товар ночью 03.05.19, пришло СМС, что товар будет у меня 05.05.19, и так же пришло СМС, что мой браслет передали службе доставки 04.05.19 в 10 утра. Так проблема заключается в том, что это курьерская конторка не работала 05.05.19, потому что это было воскресенье. Весь день я просидел дома, ожидая браслет и попутно пытаясь дозвониться до конторки доставки, но все было тщетно. Только после того, как я позвонил напрямую поставщику, они мне объяснили, что у конторки-то выходной. Как следствие, просидел дома целый день, и меня даже не предупредили, что товара не будет. Хотя контакты есть у них, безалаберность.<br>\nУтром понедельника я всё-таки дозвонился до конторки и спросил, когда придет мой товар, и заодно поменял адрес. Ибо работать нужно. Также спросил, почему меня не уведомили. На что получил неразборчивое мычание в трубку. Далее я спросил, когда ожидать заказ, а именно в какое время. На что мне сказали, что не знают, в течения дня нужно ждать.<br>\nКак следствие, товар прибыл только в ближе к 4 вечера. Так ещё они звонили и пытались завести товар по старому адресу. Хотя я сделал переадресацию.<br>\nКонторка Gallop очень плохая, с курьером не связаться, точное время не узнать. Уж лучше я самовывоз организовал бы. Крайне не советую ждать доставку от Gallop. Благо хоть товар не повредили."
            },
