                "plus": "Отличная вещь! Использую как \"непропускатель звонков и смс\", так как мой телефон очень тихий, постоянно ко мне не дозванивались! Незаменимая вещь, если в доме маленькие  дети. Поставил телефон на без звука, а браслет обо всем скажет.\nШаги считает корректно. Пульс вообще супер точно!<br>\nЕще одна функция прям замечательная - это контроль телефона рядом. Не нужно носить сумочку. Посмотрел на сигнал, если он есть, значит телефон с тобой. Ну а поиск телефона - это гениально. На ключи брелок если бы придумали такой, цены бы не было!",
