let result = [];

function parser(data) {
    result = [];
    let name = '';

    data.forEach((item) => {
        if (typeof item === 'string') {
            name = item;
        } else {
            item.forEach((i) => {
                i.data.forEach((j) => {
                    let obj = {};
                    obj['Name'] = name;
                    obj['Rating'] = j.rating;
                    obj['Positive'] = j.comment.plus;
                    obj['Negative'] = j.comment.minus;
                    obj['Comment'] = j.comment.text;
                    result.push(obj);
                })
            });
        }
    });
}

parser(allData);

let csvString = "data:text/csv;charset=utf-8,";

csvString += [
    [
        "Name",
        "Rating",
        "Positive",
        "Negative",
        "Comment"
    ],
    ...result.map(item => [
        item["Name"],
        item["Rating"],
        item["Positive"],
        item["Negative"],
        item["Comment"]
    ])
].map(e => e.join(";"))
    .join("\n");

var encodedUri = encodeURI(csvString);
var link = document.createElement("a");
link.setAttribute("href", encodedUri);
link.setAttribute("download", "kaspi.csv");
document.body.appendChild(link); // Required for FF

link.click();